function GameController(){var n=new OpponentWeaponPicker;this.startGame=function(t){var e=n.pickNewWeapon();t.winWith(e)?alert("win"):alert("lose")}}function OpponentWeaponPicker(){var n=(new AvailableWeaponsEnumerator).weapons;this.pickNewWeapon=function(){var t=Math.floor(Math.random()*n.length);return n[t]}}function AvailableWeaponsEnumerator(){this.weapons=[new Rock,new Paper,new Scissors]}function Paper(){Weapon.call(this),this.getName=function(){return"Paper"},this.winWith=function(n){return n instanceof Rock}}function Rock(){Weapon.call(this),this.getName=function(){return"Rock"},this.winWith=function(n){return n instanceof Scissors}}function Scissors(){Weapon.call(this),this.getName=function(){return"Scissors"},this.winWith=function(n){return n instanceof Paper}}function Weapon(){this.getName=function(){return"Unknown weapon"},this.winWith=function(n){return null}}$(document).ready(function(){var n=new GameController;$("#rock-selector").click(function(){n.startGame(new Rock)}),$("#paper-selector").click(function(){n.startGame(new Paper)}),$("#scissors-selector").click(function(){n.startGame(new Scissors)})});